import React, { useState, useEffect } from 'react';
import {
    Button,InputGroup, InputGroupAddon, InputGroupText, Input,
  } from 'reactstrap';
import Navig from './Navig';

export default function Map() {
    useEffect(()=>{
    },[]);
    return (
        <div style={{backgroundColor: 'black'}}>
          <div className='background-map'>
            <Navig/>
          </div>

          <h1 className='display-4 text-center' style={{padding: '20px', color: 'white'}}>Choose Your Trip</h1>
          <div style={{backgroundColor: '#70A19D'}}>
            <div className='d-flex justify-content-between' style={{width: '70%', padding: '15px', margin: 'auto'}}>
              <div className='d-flex justify-content-between' style={{width: '30%', fontSize: '20px'}}>
                <span>From: Paris, France</span>
                <span>To: Mars</span>
              </div>
              <div className='d-flex justify-content-between' style={{width: '30%', fontSize: '20px'}}>
                <span>From: 10/04/2020</span>
                <span>To: 30/04/2020</span>
              </div>
              <Button>Modify</Button>
            </div>
          </div>
          <div style={{backgroundColor: '#54757E', height: '100px'}}></div>

          <div className='background-map2'></div>

        </div>
    )
}
